import './App.css';

function App() {
  return (
    <div className="App">
      <header>User Signup</header>
      <br/>

      <>
      <label>Name </label>
      <input type='text'/>
      </>
      <br/>
      <br/>
      <>
      <label>Email </label>
      <input type='email'/>
      </>
    </div>
  );
}

export default App;
